let h1Style = {
    "fontFamily": "'Roboto', sans-serif",
    "color": "white",
    "fontSize": "40px",
    "margin-left": "20px"
}

function Brand() {
    return (
        <>
        <h1 style={h1Style}>T-Hagen Hardware</h1>
        </>
    )
}

export default Brand
